import {CREATE_DATA, START_POST_REQUEST} from "../types"

const handlerDataSave = (data)=>{
    
    return {
        type: CREATE_DATA,
        payload: data
    }
}

const start_POST_RequestServer = ()=>{
    
    return{ 
        type: START_POST_REQUEST
    }
}


export {handlerDataSave, start_POST_RequestServer}
